import styles from './Table.module.css'
import TableItem from './TableItem'
import { useSelector } from 'react-redux'
import { selectData, fetchData } from '../State/dataSlice'
import { useEffect } from 'react'

function Table({ start, end }) {
  useEffect(() => {
    fetchData('http://localhost:5000/api/data')
  }, [])

  const dataInfo = useSelector(selectData)

  const f = async () => {
    await axios
      .post('http://localhost:5000/api/data', { data: [dataState] })
      .then(function (response) {
        console.log(response.data)
      })
      .catch(function (error) {
        console.log(error)
      })
  }

  return (
    <div className={styles.container}>
      <header>
        <div className={styles.table_header__items}>
          <h2>Номер запроса</h2>
        </div>
        <div className={styles.table_header__items}>
          <h2>Тип запроса</h2>
        </div>
        <div className={styles.table_header__items}>
          <h2>Описание</h2>
        </div>
        <div className={styles.table_header__items}>
          <h2>Пользователь</h2>
        </div>
        <div className={styles.table_header__items}>
          <h2>Дата</h2>
        </div>
        <div className={styles.table_header__items}>
          <h2>Статус</h2>
        </div>
      </header>
      {dataInfo
        .slice(
          start >= 0 ? start : 0,
          end > dataInfo.length ? dataInfo.length : end
        )
        .map((el, id) => {
          return (
            <TableItem
              key={id}
              number={el.number}
              type={el.typeRequest}
              description={el.description}
              user={el.userName}
              data={el.data}
              stat={el.status}
            />
          )
        })}
      {/* <TableItem
        number={1}
        type={`Новая функциональность`}
        description={`Прошу в сервис Свойства газа добавить`}
        user={`Иванов Иван Иванович`}
        data={`12.06.2023`}
        stat={`В работе`}
      /> */}
    </div>
  )
}

export default Table
